gotoAndPlay(_parent.近战招式);

冲刺轮数 = 0;
if(!_parent.冲刺轮数总数){
	_parent.冲刺轮数总数 = 2;
}

冲刺轮数+=0.5;
if(冲刺轮数 >= _parent.冲刺轮数总数){
	_parent.动画完毕();
}

if(冲刺轮数 >= _parent.冲刺轮数总数){
	_parent.动画完毕();
}else{
	gotoAndPlay("后撤循环");
	//gotoAndPlay(95);
}


//基于追踪改的距离判断派生招式
敌方目标 = _root.gameworld[_parent.攻击目标];
距离X = Math.abs(_parent._x - 敌方目标._x);

if (距离X >= 500)
{
	gotoAndPlay("站桩射击")
}
else
{
	gotoAndPlay("后空翻扔雷")
}

冲刺轮数 = 0;
if(!_parent.冲刺轮数总数){
	_parent.冲刺轮数总数 = 2;
}

