//基于追踪改的距离判断派生招式
敌方目标 = _root.gameworld[_parent.攻击目标];
距离X = Math.abs(_parent._x - 敌方目标._x);


if(冲刺轮数 >= _parent.冲刺轮数总数){
	if (距离X <= 300)
	{	
		gotoAndPlay("这里结束")
	}
	else
	{
		_parent.动画完毕();
	}
}

//基于追踪改的距离判断派生招式
敌方目标 = _root.gameworld[_parent.攻击目标];
距离X = Math.abs(_parent._x - 敌方目标._x);

if (距离X <= 300)
{
	gotoAndPlay("这里结束")
}
else if(冲刺轮数 >= _parent.冲刺轮数总数){
	gotoAndPlay("这里结束");
}else{
	gotoAndPlay("循环跑从这里开始");
	//gotoAndPlay(95);
}

//基于追踪改的距离判断派生招式
敌方目标 = _root.gameworld[_parent.攻击目标];
